import React from 'react'; 
import GoogleLogin from 'react-google-login';
import './Login/Login.css';
import axios from 'axios';
import { Component } from 'react';

export class Oauth extends Component {
	constructor(props) {
		super(props);
		this.state = {};
	}
	signup(res) {
		const googleresponse = {
			Name: res.profileObj.Name,
			Email: res.profileObj.Email,
			token: res.googleId,
			ProviderId: 'Google',
		};
		debugger;
		axios
			.post('http://localhost:52511/api/Login/AuthorizeUser', googleresponse)
			.then((result) => {
				let responseJson = result;
				sessionStorage.setItem('OauthLogin', JSON.stringify(responseJson));
				this.props.history.push('/appdrawer');
			});
	}
	render() {
		const responseGoogle = (response) => {
			console.log('Key', response.accessToken);
			// const Token = response.accessToken;
			// const token = response.data.accessToken;
			const res = response.profileObj;
			console.log('new', res);
			console.log('email', res.email);
			const email = res.email;
			console.log('name', res.name);
			const name = response.name;
			debugger;
			this.signup(response);
		};
		return (
			<>
				<GoogleLogin
					className='Btn_gool'
					clientId='221324650717-apsoi42p4mg35gmjipluh6lroo01op1j.apps.googleusercontent.com'
					uxMode='redirect'
					redirectUri='http://localhost:3000/appdrawer'
					buttonText='Login with Google'
					onSuccess={responseGoogle}
					onFailure={responseGoogle}
				></GoogleLogin>
			</>
		);
	}
}

export default Oauth;
